import React from "react";

export default function index() {
  const style = {
    height: "120px",
    maxWidth: 940,
    margin: "auto",
    width: "100%",
    background: "url(img/back-news.png)",
    backgroundSize: "100%",
    backgroundRepeat: "no-repeat",
  };
  return <div style={style}></div>;
}
